import 'dart:convert';List<GetAlbum> welFromJson(String str) => List<GetAlbum>.from(json.decode(str).map((x) => GetAlbum.fromJson(x)));String welToJson(List<GetAlbum> data) => json.encode(List<dynamic>.from(data.map((x) => x.toJson())));class GetAlbum {  GetAlbum({    this.albumId,    this.id,    this.title,    this.url,    this.thumbnailUrl,  });  int albumId;  int id;  String title;  String url;  String thumbnailUrl;  factory GetAlbum.fromJson(Map<String, dynamic> json) => GetAlbum(    albumId: json["albumId"],    id: json["id"],    title: json["title"],    url: json["url"],    thumbnailUrl: json["thumbnailUrl"],  );  Map<String, dynamic> toJson() => {    "albumId": albumId,    "id": id,    "title": title,    "url": url,    "thumbnailUrl": thumbnailUrl,  };}